datasource/es.html.body:
ElasticSearch
ElasticSearch 是一个应用很广泛的数据系统。MLSQL也支持将其中的某个索引加载为表。
注意，ES的包并没有包含在MLSQL默认发型包里，所以你需要通过 --jars 带上相关的依赖才能使用。
加载数据
示例：
set data='''
{"jack":"cool"}
''';

load jsonStr.`data` as data1;

save overwrite data1 as es.`twitter/cool` where
`es.index.auto.create`="true"
and es.nodes="127.0.0.1";

load es.`twitter/cool` where
and es.nodes="127.0.0.1"
as table1;
select * from table1 as output1;

connect es where  `es.index.auto.create`="true"
and es.nodes="127.0.0.1" as es_instance;

load es.`es_instance/twitter/cool`
as table1;
select * from table1 as output2;

在ES里，数据连接引用和表之间的分隔符不是.,而是/。 这是因为ES索引名允许带"."。
所以es相关的参数可以参考驱动官方文档。

datasource/mongodb.html.body:
MongoDB
MongoDB 是一个应用很广泛的存储系统。MLSQL也支持将其中的某个索引加载为表。
注意，MongoDB，所以你需要通过 --jars 带上相关的依赖才能使用。
加载数据
示例：
set data='''
{"jack":"cool"}
''';

load jsonStr.`data` as data1;

save overwrite data1 as mongo.`twitter/cool` where
    partitioner="MongoPaginateBySizePartitioner"
and uri="mongodb://127.0.0.1:27017/twitter";

load mongo.`twitter/cool` where
    partitioner="MongoPaginateBySizePartitioner"
and uri="mongodb://127.0.0.1:27017/twitter"
as table1;
select * from table1 as output1;

connect mongo where
    partitioner="MongoPaginateBySizePartitioner"
and uri="mongodb://127.0.0.1:27017/twitter" as mongo_instance;

load mongo.`mongo_instance/cool`
as table1;
select * from table1 as output2;

load mongo.`cool` where
    partitioner="MongoPaginateBySizePartitioner"
and uri="mongodb://127.0.0.1:27017/twitter"
as table1;
select * from table1 as output3;

在MongoDB里，数据连接引用和表之间的分隔符不是.,而是/。

datasource/file.html.body:
Parquet/Json/Text/Xml/Csv
MLSQL支持大部分HDFS/本地文件数据读取。对于数据的保存或者加载，后面都可以接where语句。
where语句的配置选项随着数据源的不同而不同个，比如csv格式需要设置是否保留header。一些共性
需求如保存后的文件数，可以同构fileNum等参数设置。
值得注意的是，where条件所有的value都必须是字符串，也就是必须用" 或者'''括起来。所有value可以使用set得到的
变量。下面是一些示例：
