{"jack":1,"jack2":2}
{"jack":2,"jack2":3}
''';

set savePath="/tmp/jack";

load jsonStr.`rawData` as table1;

save overwrite table1 as parquet.`${savePath}`;

load parquet.`${savePath}` as table2;

