variable/sql.html.body:
SQL模式
SQL模式可以充分利用一些SQL内置或者自己开发的UDF函数的优势。
比如我要获取日期可以这么搞：
set day_id=`select current_date()` options type="sql";
select "${day_id}" as a as test111;

当然，你也可以自己写段scala或者python脚本注册成udf函数，然后赋给变量，也是不错的选择：

-- 自定义 scala 的 UDF 方法

register ScriptUDF.`` as welcome
where lang="scala"
and code='''
def apply(str:String)={
    str
}
''';

set welcome_msg=`select welcome("hellow") as k` options type="sql";
select "${welcome_msg}" as a as output;

其实可以实现很多复杂场景的功能，大家可以根据自己的实际情况灵活使用。

process/select.html.body:
Select 语法
MLSLQ中 select语法其实就是标准的select 语句然后加上 一个 as [tableName]; 
因为在MLSQL看来，select语句本质是transformer,把数据从原表处理成新表。
看起来会是这样：
set rawData=''' 
{"jack":1,"jack2":2}
{"jack":2,"jack2":3}
''';

load jsonStr.`rawData` as table1;

select jack+2 as newjack from table1 -- 标准的sql 
as table2; -- sql处理后，我们给这条sql产生的数据取个名字

-- 我可以引用前面申明了的table2继续做处理
select * from table2 as table3;

通过组合大量这种语句，我们可以避免去写非常复杂的SQL语句。每条SQL都会产生一张新的表，这些表可以在后续的SQL里继续使用，从而
降低SQL的复杂度。

process/save.html.body:
Save语法
在前面的文章中，我们已经多次看到了save语法的身影。 save和load是对应的，load是加载数据映射成表，save则是把表存储到具体的存储引擎里。
比如
set rawData=''' 
{"jack":1,"jack2":2}
{"jack":2,"jack2":3}
''';

set savePath="/tmp/jack";

load jsonStr.`rawData` as table1;

save overwrite table1 as json.`${savePath}`;

save 后面一个参数overwrite|append可选。表示覆盖或者追加。 save语法最后可以接where条件。比如：
save overwrite table1 as json.`${savePath}` where fileNum="10";

这样，存储的内容会被分成10份，通过这种方式可以避免大量的小文件。
对于表，我们其实也可以直接通过run语法来先进行分区：
run table1 as RepartitionExt.`` where partitionNum="10" as newTable;
save overwrite newTable as json.`/tmp/newTable`;

在前面数据源章节，我们也演示了如何使用save将数据存储到各种存储引擎里，比如es/mysql等。

